import React from "react";
import { Row, Col, Accordion } from "react-bootstrap";

const creditsData = [
    {
        id: 11,
        name: "david",
        email: "david@email.com",
        total_amount: 703.32,
        credits_group_breakdown: [
            {
                amount: 100.0,
                group_id: 7,
                group_name: "second",
            },
            {
                amount: 603.32,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
    {
        id: 10,
        name: "charlie",
        email: "charlie@email.com",
        total_amount: 286.36,
        credits_group_breakdown: [
            {
                amount: 286.36,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
];

const debtsData = [
    {
        id: 1,
        name: "Jeus",
        email: "jeus@email.com",
        total_amount: 286.36,
        debts_group_breakdown: [
            {
                amount: 286.36,
                group_id: 6,
                group_name: "another group ",
            },
            {
                amount: 100.0,
                group_id: 7,
                group_name: "second",
            },
        ],
    },
    {
        id: 3,
        name: "tim",
        email: "tim@email.com",
        total_amount: 124.96,
        debts_group_breakdown: [
            {
                amount: 124.96,
                group_id: 6,
                group_name: "another group ",
            },
        ],
    },
];

const FriendsCreditDebit = () => {
    return (
        <Row>
            {/* Left Box - Users you owe */}
            <Col xs={6} className="p-0">
                <div className="border border-primary text-center">
                    <h3>Users you owe</h3>
                </div>
                {debtsData.map((user) => (
                    <Accordion key={user.id} className="friends-accordian m-0">
                        <Accordion.Item
                            eventKey={user.id}
                            classname="friends-accordian"
                        >
                            <Accordion.Header>
                                <div className="w-100 d-flex justify-content-between">
                                    <div>{user.name}</div>
                                    <div className="px-3">
                                        Total Amount:{" "}
                                        <span className="text-secondary">
                                            ${user.total_amount}
                                        </span>
                                    </div>
                                </div>
                            </Accordion.Header>
                            <Accordion.Body>
                                {user.debts_group_breakdown.map(
                                    (debt, index) => (
                                        <div
                                            key={index}
                                            className="d-flex justify-content-between  mb-3"
                                        >
                                            <div>{debt.group_name}</div>
                                            <div>
                                                Amount:{" "}
                                                <span className="text-secondary">
                                                    ${debt.amount}
                                                </span>
                                            </div>
                                        </div>
                                    )
                                )}
                            </Accordion.Body>
                        </Accordion.Item>
                    </Accordion>
                ))}
            </Col>

            {/* Right Box - Users owe you */}
            <Col xs={6} className="border border-primary p-0">
                <div className="border border-primary text-center">
                    <h3>Users owe you</h3>
                </div>
                {creditsData.map((user) => (
                    <Accordion key={user.id}>
                        <Accordion.Item eventKey={user.id}>
                            <Accordion.Header>
                                <div className="w-100 d-flex justify-content-between">
                                    <div>{user.name}</div>
                                    <div className="px-3">
                                        Total Amount:{" "}
                                        <span className="text-primary">
                                            ${user.total_amount}
                                        </span>
                                    </div>
                                </div>
                            </Accordion.Header>
                            <Accordion.Body>
                                {user.credits_group_breakdown.map(
                                    (credit, index) => (
                                        <div
                                            key={index}
                                            className="d-flex justify-content-between mb-3"
                                        >
                                            <div>{credit.group_name}</div>
                                            <div>
                                                Amount:{" "}
                                                <span className="text-primary">
                                                    ${credit.amount}
                                                </span>
                                            </div>
                                        </div>
                                    )
                                )}
                            </Accordion.Body>
                        </Accordion.Item>
                    </Accordion>
                ))}
            </Col>
        </Row>
    );
};

export default FriendsCreditDebit;
